(236, 'Hil Caféen?', 2003, 'Hil Atlantis', 'Thomas Høg', 2, 2, '', '<p class="verse">\r\n<em>K</em><span> Jeg sku\\'' ha\\'' vær\\''t til Dat1E.\r</span>\n<em>W</em><span> Det slutter eg\\''ntlig klokken tre.\r</span>\n<em>K</em><span> Jeg slider som en hest,\r</span>\n<em></em><span>men nu vil jeg ha\\'' fest,\r</span>\n<em></em><span>og det er her, man fester bedst.\r</span>\n</p><p class="verse">\r\n<em>W</em><span> Vort liv på DIKU started\\'' her\r</span>\n<em>Kor</em><span> det\\'' meget sjover\\'' end Dat0!\r</span>\n<em>W</em><span> Vort liv på DIKU ender her\r</span>\n<em>DR1</em><span> Det er da bedre end et eller andet andet hul! (råbes)\r</span>\n<em>W</em><span> Så hør de vise ord:\r</span>\n<em></em><span>Det\\'' her, dit hjerte bor.\r</span>\n<em></em><span>Gå kold! Og vågn til druk og hor!\r</span>\n</p><p class="chorus">\r\n<em>Kor+K+W</em><span> Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>Vores hjem igennem alle år!\r</span>\n<em></em><span>Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>Dumper vi, så ved vi, du består!\r</span>\n</p><p class="verse">\r\n<em>K</em><span>           Se, sådan skænker man en øl.\r</span>\n<em>Kor</em><span>         Lær os/dem at blande mad på fad.\r</span>\n<em>W</em><span>           Ha\\'' altid flasker nok på køl.\r</span>\n<em>Kor</em><span>         Så bliver kunden glad.\r</span>\n<em></em><span>             Vel er her lidt beskidt,\r</span>\n<em>Kor+W+K</em><span>     fordi vi er her tit.\r</span>\n<em></em><span>             Det lort, du ser, er dit og mit.\r</span>\n</p><p class="chorus">\r\n<em>Kor+K+W</em><span>     Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>             Vores hjem igennem alle år!\r</span>\n<em></em><span>             Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>             Dumper vi, så ved vi, du består!\r</span>\n</p><p class="verse">\r\n<em>K</em><span>           Så lad mig drikke lidt igen.\r</span>\n<em>Kor</em><span>         Årh, mand, hvor er du stærk og sej.\r</span>\n<em>W</em><span>           Jeg læser bedst med tømmermænd.\r</span>\n<em>Kor</em><span>         Åh, nej! Han brækker sig.\r</span>\n<em>W</em><span>           Når aldrig til Dat2.\r</span>\n<em>Kor</em><span>         Vi dumper!\r</span>\n<em>W</em><span>           Det er for højt niveau.\r</span>\n<em>Kor</em><span>         Vi dumper!\r</span>\n<em>W</em><span>           For mig, for jeg er datalog.\r</span>\n</p><p class="chorus">\r\n<em>Kor+K+W</em><span>     Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>             Vores hjem igennem alle år!\r</span>\n<em></em><span>             Hil Caféen! Pris Caféen!\r</span>\n<em></em><span>             Dumper vi, så ved vi, du består!\r</span>\n</p>', '\\\\begin{verse}\r\n\\\\sings{K} Jeg sku\\'' ha\\'' vær\\''t til Dat1E.\r\n\\\\sings{W} Det slutter eg\\''ntlig klokken tre.\r\n\\\\sings{K} Jeg slider som en hest,\r\nmen nu vil jeg ha\\'' fest,\r\nog det er her, man fester bedst.\r\n\\\\end{verse}\r\n\r\n\\\\begin{verse}\r\n\\\\sings{W} Vort liv på DIKU started\\'' her\r\n\\\\sings{Kor} det\\'' meget sjover\\'' end Dat0!\r\n\\\\sings{W} Vort liv på DIKU ender her\r\n\\\\sings{DR1} Det er da bedre end et eller andet andet hul! (råbes)\r\n\\\\sings{W} Så hør de vise ord:\r\nDet\\'' her, dit hjerte bor.\r\nGå kold! Og vågn til druk og hor!\r\n\\\\end{verse}\r\n\r\n\\\\begin{chorus}\r\n\\\\sings{Kor+K+W} Hil Caféen! Pris Caféen!\r\nVores hjem igennem alle år!\r\nHil Caféen! Pris Caféen!\r\nDumper vi, så ved vi, du består!\r\n\\\\end{chorus}\r\n\r\n\\\\begin{verse}\r\n\\\\sings{K}           Se, sådan skænker man en øl.\r\n\\\\sings{Kor}         Lær os/dem at blande mad på fad.\r\n\\\\sings{W}           Ha\\'' altid flasker nok på køl.\r\n\\\\sings{Kor}         Så bliver kunden glad.\r\n             Vel er her lidt beskidt,\r\n\\\\sings{Kor+W+K}     fordi vi er her tit.\r\n             Det lort, du ser, er dit og mit.\r\n\\\\end{verse}\r\n\r\n\\\\begin{chorus}\r\n\\\\sings{Kor+K+W}     Hil Caféen! Pris Caféen!\r\n             Vores hjem igennem alle år!\r\n             Hil Caféen! Pris Caféen!\r\n             Dumper vi, så ved vi, du består!\r\n\\\\end{chorus}\r\n\r\n\\\\begin{verse}\r\n\\\\sings{K}           Så lad mig drikke lidt igen.\r\n\\\\sings{Kor}         Årh, mand, hvor er du stærk og sej.\r\n\\\\sings{W}           Jeg læser bedst med tømmermænd.\r\n\\\\sings{Kor}         Åh, nej! Han brækker sig.\r\n\\\\sings{W}           Når aldrig til Dat2.\r\n\\\\sings{Kor}         Vi dumper!\r\n\\\\sings{W}           Det er for højt niveau.\r\n\\\\sings{Kor}         Vi dumper!\r\n\\\\sings{W}           For mig, for jeg er datalog.\r\n\\\\end{verse}\r\n\r\n\\\\begin{chorus}\r\n\\\\sings{Kor+K+W}     Hil Caféen! Pris Caféen!\r\n             Vores hjem igennem alle år!\r\n             Hil Caféen! Pris Caféen!\r\n             Dumper vi, så ved vi, du består!\r\n\\\\end{chorus}\r\n', ''),
